const Bitmap_t PUMAS_LOGO_64x64 = {
    .width = 64,
    .height = 64,
    .data = PUMAS_LOGO_64x64_data
};
void images_draw_bitmap(const Bitmap_t *bitmap, uint8_t x, uint8_t y) {
    uint8_t byte_idx = 0;
    uint8_t page_height = bitmap->height / 8; // Número de páginas de la imagen (64/8 = 8)

    // Iterar sobre las columnas de la imagen
    for (uint8_t col = 0; col < bitmap->width; col++) {
        // Iterar sobre las páginas verticales de la imagen
        for (uint8_t page = 0; page < page_height; page++) {
            // Obtener el byte de datos que representa 8 píxeles verticales
            uint8_t byte = bitmap->data[byte_idx];
            
            // Iterar sobre los 8 píxeles dentro de ese byte
            for (uint8_t bit = 0; bit < 8; bit++) {
                // Calcular las coordenadas absolutas en la pantalla
                uint8_t screen_x = x + col;
                uint8_t screen_y = y + (page * 8) + bit;
                
                // Si el bit está encendido, dibujar un píxel (1)
                if (byte & (1 << bit)) {
                    // Usamos la función de dibujo de tu ssd1306.c
                    ssd1306_draw_pixel(screen_x, screen_y, 1);
                } else {
                    // Dibujar un píxel apagado (0) (opcional, si no limpias la pantalla)
                    ssd1306_draw_pixel(screen_x, screen_y, 0);
                }
            }
            byte_idx++; // Avanzar al siguiente byte (siguiente columna/página)
        }
    }
}





